//=======================================================
// HTML5 Listening 聽音辨字六選一 [啟始的設定檔]
//=======================================================

//---------------------------------
//啟動時的標題字
//---------------------------------
title = '聽音辨字六選一';


//----------------
//Google TTS 文字轉語音的設定
//----------------

//TTS 語言代碼(英文: 'en-US' , 中文: 'zh-TW')
tts_language = 'en-US';  

//TTS 語音的速度 0 ~ 1 (可用小數)
tts_speed = 0.3;  

//TTS 網址組合規則
tts_base_url = 'https://translate.google.com/translate_tts?ie=UTF-8&tl=${tts_language}&client=tw-ob&ttsspeed=${tts_speed}&q=${query}';


//--------------------------------------------------------------
// 音效設定
//--------------------------------------------------------------
//音效(base64編碼)

sound_click_file = 'assets/sound_click.mp3';
sound_click_mp3 = 'data:audio/mp3;base64,';
sound_click_ogg = 'data:audio/ogg;base64,';

sound_correct_file = 'assets/sound-ding-dong.mp3';
sound_correct_mp3 = 'data:audio/mpeg;base64,';
sound_correct_ogg = 'data:audio/ogg;base64,';

sound_wrong_file = 'assets/sound_wrong.mp3';
sound_wrong_mp3 = 'data:audio/mp3;base64,';
sound_wrong_ogg = 'data:audio/ogg;base64,';



